import React from "react";
function DIETPLAN(){
    return(
        <div className="page-background">
            <div className="contain">
                <a href=""><img src='images/backArrow.png' alt="Bck" className="back"/></a>
                <h6>Daily Nutrition Plan</h6>
            </div>
            <p>This is your recommended daily intake based on your preferences and health</p><br/>
            
            <div>
                <h6>Calories<li>7536 kj</li></h6>
            </div>

        </div>
    )
}
export default DIETPLAN
